import DigitalChannelAffinity from "./digitalChannelAffinity";

function Dashboard() {
  return (
    <Grid
      sx={{ paddingLeft: "32px", paddingRight: "32px", paddingTop: "32px" }}
    >
      {/* <Grid container>
        {FILTER.map((item) => {
          return (
            <Box xs={3}>
              <BasicSelect filter={item} />
            </Box>
          );
        })}
      </Grid> */}
      <Typography
        sx={{
          color: "#101828",
          fontFamily: "inter",
          fontWeight: "500",
          fontSize: "24px",
          lineHeight: "32px",
          paddingBottom: "24px",
        }}
      >
        Channel Affinity
      </Typography>

      {/* Heat Map Chart */}
      <HeatMapAffinity/>

      {/* Horizontal Bar Chart */}
      <Box sx={{ marginBottom: "24px" }}>
        <HorizontalBarChart />
      </Box>

      {/* Digital Channel Affiniy */}
      <DigitalChannelAffinity/>
    </Grid>
  );
}

export default Dashboard;
